import success from '../images/success.png';
import noSuccess from '../images/noSuccess.png';
import { useParams } from 'react-router-dom';

export default function PopupMassege(props) {
  let match = useRouteMatch('/login');
  return (
    <div className={props.isOpen ? `popup ` : `popup  popup-hidden`}>
      <div className='popup-massege'>
        <button
          onClick={props.onClose}
          className='popup__close-button'
          type='button'
        />
        <img
          className='popup-massege__icon'
          src={props.isSuccess ? success : noSuccess}
          alt='icon'
        />
        <p className='popup-massege__massege'>
          {props.isSuccess
            ? `Success! You have now been registered.`
            : `Oops, something went wrong! Please try again.`}
        </p>
      </div>
    </div>
  );
}
